import data from "./data";
import HomeScreen from "./Screens/HomeScreen";

import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (

    <Router>

    <div className="App">
      <header>
        <a href="/">Amazona</a>
      </header>
      <main>
   
          <Routes>
          <Route path="/product/:" element={<HomeScreen />} />
          <Route path="/" element={<HomeScreen />} />
          </Routes>
      
        
      </main>
    </div>
    </Router>
  );
}

export default App;
